skyy1="/assets/TrumpandZelenskyy1.CK10nWW8.jpg",Siheng="/assets/siheng.WZKswZ6M.jpg",POSTS_DETAIL=[{id:1,title:"트럼프와 젤렌스키 정상회담 요약: 2025년 2월 백악관 회담 핵심만 정리",views:0,excerpt:"트럼프와 젤렌스키 정상회담, 백악관에서 무슨 일 있었을까?",category:"트럼프와 젤렌스키,뉴스",content:`<body>\n    <h2>트럼프와 젤렌스키 정상회담, 백악관에서 무슨 일 있었을까?</h2>\n    <p>안녕하세요, 여러분! 오늘은 2025년 2월 28일 백악관에서 있었던 트럼프와 젤렌스키 정상회담에 대해 이야기해보려고 해요. 이 회담은 러시아-우크라이나 전쟁을 끝내는 방안과 광물 협정을 논의하려던 자리였는데, 기대했던 것과 달리 꽤나 뜨겁게 끝났어요.</p>\n    <p>그리고 그 이후에도 뉴스가 계속 나오고 있어서, 최신 소식과 함께 유럽연합(EU)의 반응까지 정리해볼게요. 궁금하시죠? 자, 하나씩 차근차근 살펴볼게요!</p>\n\n    <h2>회담에서 있었던 주요 순간들</h2>\n\n    <h3>1. 따뜻한 시작, 곧 갈등으로</h3>\n    <p>회담은 처음엔 괜찮았어요. 트럼프가 "젤렌스키 대통령의 방문이 영광이다"라며 우크라이나 군인들의 용기를 칭찬했고, 젤렌스키도 "미국에 감사하다"고 답했어요. 분위기가 나쁘지 않게 시작된 거죠.</p>\n    <p>그런데 곧 문제가 터졌어요. 트럼프는 러시아와 협상해서 전쟁을 끝내자고 했고, 젤렌스키는 "안전 보장이 없으면 휴전은 안 된다"고 맞섰어요. 여기서부터 두 사람의 입장이 충돌하기 시작했어요.</p>\n    <img src="${TrumpandZelenskyy1}" alt="트럼프와 젤렌스키 정상회담 인포그래픽" />\n    <h3>2. 설전으로 뜨거워진 분위기</h3>\n    <p>대화가 점점 격해졌어요. 트럼프가 "젤렌스키가 푸틴을 너무 싫어해서 협상이 어렵다"고 하자, 젤렌스키는 "푸틴이 약속을 25번이나 어겼다"고 반박했어요. 그러자 부통령 JD 밴스가 "트럼프는 평화를 위해 노력하는데 여기서 따지는 건 무례하다"고 끼어들었고요.</p>\n    <p>젤렌스키는 "그게 무슨 외교냐, 푸틴은 민스크 협정을 깼다"고 쏘아붙였어요. 뉴스 보니까 이 대화가 오벌 오피스에서 꽤 큰 소리로 오갔다고 하더라고요. 감정이 격해지면서 분위기가 완전히 엉망이 됐어요.</p>\n\n    <h3>3. 조기 종료와 파국</h3>\n    <p>결국 트럼프가 "너무 감정적으로 나오면 수백만 목숨과 3차 세계대전을 건다"고 강하게 나왔어요. "미국에 무례하다"고까지 했고, 회담은 깨졌죠. 트럼프는 SNS에 "평화 준비가 안 됐다면 나중에 오라"고 올리며 끝냈어요.</p>\n    <p>원래 광물 협정(미국이 우크라이나 희토류 자원을 얻고 지원을 늘리는 방안)과 공동 기자회견도 계획돼 있었는데, 다 무산됐어요. 젤렌스키는 빈손으로 돌아갔고, 긴장감만 남았네요.</p>\n\n    <h2>최신 소식: 관계 회복 시도와 군사 원조 논란</h2>\n    <p>회담 이후에도 이야기가 이어졌어요. 3월 4일, 젤렌스키가 소셜 미디어에 "백악관 회담이 잘 안 된 건 아쉽다"고 올렸어요. 그러면서 "트럼프의 강한 리더십 아래 평화를 위한 협상에 나설 준비가 됐다"고 했죠. 관계를 풀어보려는 시도로 보였어요.</p>\n    <p>트럼프도 "젤렌스키가 협상 의지를 담은 편지를 보냈다"고 답했고, "러시아도 평화에 준비돼 있다는 신호를 받았다"고 했어요. 근데 트럼프 정부는 군사 원조를 일시 중단한다고 발표했어요. 뉴스에서는 이게 젤렌스키를 협상 테이블로 끌어내려는 압박이라고 분석하더라고요.</p>\n    <p>우크라이나 군은 "원조 중단은 배신"이라며 불안해하고 있고, 영국 총리 키어 스타머는 "트럼프를 믿는다"고 했지만, 프랑스 대통령 마크롱은 "젤렌스키의 협상 의지를 환영한다"고 하면서도 우려를 숨기지 않았어요.</p>\n\n    <h2>유럽연합의 반응: 젤렌스키 지지와 새로운 리더십 고민</h2>\n    <p>유럽연합(EU)은 이 회담을 보고 바로 움직였어요. EU 외교정책 수장 카야 칼라스는 "오늘 자유 세계에 새로운 리더가 필요하다는 게 분명해졌다"고 했어요. "유럽이 그 역할을 맡아야 한다"며 우크라이나 지원을 더 강화하겠다고 약속했죠.</p>\n    <p>EU 집행위원장 우르줄라 폰 데어 라이엔은 젤렌스키에게 "당신의 품격은 우크라이나 국민의 용기를 보여준다"고 했어요. "강하고 용감하게, 두려움 없이 나아가라. 당신은 절대 혼자가 아니다"라며 지지를 보냈고, 유럽의회 의장 안토니오 코스타도 같은 메시지를 전했어요.</p>\n    <p>3월 2일 런던에서 열린 유럽 리더들 모임에서도 이 얘기가 나왔어요. 키어 스타머가 주최한 이 회의에 젤렌스키도 참석했는데, EU는 미국 없이도 우크라이나를 지원할 방법을 찾고 있대요. 다만, 헝가리 총리 빅토르 오르반은 예외로 "트럼프가 평화를 위해 용감하게 나섰다"고 지지했어요.</p>\n\n    <h2>이게 의미하는 건 뭘까?</h2>\n    <p>이번 회담과 그 뒤의 소식을 보면, 미국과 우크라이나, 그리고 유럽이 전쟁을 끝내는 방법에 대해 얼마나 다르게 생각하는지 확실히 알겠어요. 트럼프는 협상으로 빠르게 끝내려 하고, 젤렌스키는 안전 보장이 우선이라고 버티죠.</p>\n    <p>EU는 미국이 빠지면 유럽이 더 큰 역할을 해야 한다고 보고 있어요. 개인적으로 트럼프는 전쟁을 멈춰서 피해를 줄이자는 거고, 젤렌스키는 우크라이나가 또 당할까 걱정하는 거라 둘 다 이해가 가네요. 여러분은 어떻게 생각하세요?</p>\n    </body>\n   `,createdAt:"2025-03-05",author:"ISIT Innovation"},{id:2,title:"시흥시 10년 공공임대주택 예비입주자 모집 소개",views:980,excerpt:"문서 요약과 시흥시 10년 공공임대주택 소개",category:"공공임대, 경기도, 뉴스",content:`<body>\n    <h1>시흥시 10년 공공임대주택 예비입주자 모집</h1>\n\n    <h4>시흥시 10년 공공임대주택 소개</h4>\n\n    <h3>공고 요약</h3>\n    <p>LH(한국토지주택공사)에서 올린 <strong>"시흥시 10년 공공임대주택 예비입주자 모집"</strong> 공고를 살펴봤어요. 공고는 2025년 2월 28일에 시작됐고, 마감은 <strong>2025년 3월 17일</strong>까지예요. 지금(2025년 3월 5일 기준)도 신청 가능하니 시간 여유 있으시죠. 담당은 <strong>경기남부지역본부</strong>에서 하고 있고, 궁금하신 건 <strong>1600-1004</strong>로 문의하시면 됩니다. 공고문에는 .hwp와 .pdf 파일도 있고, 단지별 팜플렛(목감, 배곧, 은계, 장현 등)도 첨부돼 있어서 미리 보실 수 있어요.</p>\n\n    <h3>10년 공공임대주택이란?</h3>\n    <p>10년 공공임대는 LH 같은 공공기관이 제공하는 주택으로, 10년 동안 저렴한 임대료로 살 수 있는 제도예요. 10년 뒤에는 분양 전환해서 내 집으로 만들 기회도 있죠. 임대료는 보증금과 월세로 나뉘는데, 법에 따라 시세보다 훨씬 저렴하게 책정돼 부담이 적어요. 단, 조건이 하나 있는데요, 공고일(2025.02.28)부터 분양 전환 때까지 <strong>무주택자</strong>여야 하고, 임대권을 남한테 넘기거나 재임대하는 건 안 됩니다.</p>\n\n    <h3>이번 공고의 단지들</h3>\n    <p>시흥시는 살기 좋은 곳으로 유명한데, 이번 공고는 시흥시 여러 지역에 걸쳐 단지가 나왔어요. 공고문에 팜플렛과 이미지(위치도, 배치도, 조감도)가 있어서 어떤 곳인지 감을 잡아볼 수 있죠. 주요 단지는요:</p>\n    <ul>\n        <li><strong>목감 지구</strong>: 목감10(가온수플), 목감11(리벤티움), 목감12(그레미움)\n            <p>교통도 편하고 주변 시설이 잘 돼 있어서 실용적인 생활을 원하시는 분들께 추천드려요.</p>\n        </li>\n        <li><strong>배곧 지구</strong>: 배곧1(센텀베이 1차), 배곧5(센텀베이 2차)\n            <p>신도시라 깔끔하고 현대적인 분위기예요. 바다도 가까워서 쾌적함을 좋아하시면 좋을 거예요.</p>\n        </li>\n        <li><strong>은계 지구</strong>: 은계11(네이처포레)\n            <p>한적하고 자연과 가까운 느낌이라 조용히 지내고 싶으신 분들께 어울려요.</p>\n        </li>\n        <li><strong>장현 지구</strong>: 장현21(루벤시아 1차), 장현24(루벤시아 2차)\n            <p>개발이 진행 중이라 앞으로 가치가 더 오를 수도 있는 곳이에요.</p>\n        </li>\n    </ul>\n\n    <h3>신청 자격과 조건</h3>\n    <p>신청하려면 몇 가지 확인하셔야 해요:</p>\n    <ul>\n        <li><strong>무주택</strong>: 공고일 기준으로 집이 없어야 해요.</li>\n        <li><strong>거주지</strong>: 이번 공고엔 명시 안 됐지만, 보통 수도권(서울, 인천, 경기) 거주자 대상일 가능성이 높아요. 정확한 건 공고문 원문을 보시는 게 좋아요.</li>\n        <li><strong>1세대 1신청</strong>: 한 가구에서 한 분만 신청 가능해요.</li>\n    </ul>\n    <p>소득이나 자산 조건은 따로 안 나왔는데, 예비입주자 모집이라 청약통장 없이도 신청할 수 있을지도 모르니 LH 사이트에서 확인해보세요.</p>\n\n    <h3>임대료와 분양 전환</h3>\n    <p>임대료는 보증금과 월세로 나눠져요. 정확한 금액은 공고문에 안 나왔지만, 예전 사례 보면 보증금은 몇천만 원대, 월세는 20~50만 원 정도로 시세보다 저렴해요. 2년마다 갱신하면서 물가 반영돼 조금 오를 수 있고요. 10년 뒤 분양 전환하면 시세보다 저렴하게 살 수 있어서 장기적으로 계획 세우시는 분들께 유리하죠.</p>\n\n    <h3>신청 방법</h3>\n    <p>참조 : <a href="https://www.lh.or.kr/apply/apply_01.do" target="_blank">LH 청약플러스시흥시 10년 공공임대주택 예비입주자 모집</a></p>\n    <p>신청은 <a href="http://apply.lh.or.kr" target="_blank">LH 청약플러스</a> 사이트에서 하시면 돼요. 과정은 간단해요:</p>\n    <ol>\n        <li>개인정보 입력</li>\n        <li>공동인증서로 로그인</li>\n        <li>원하는 단지 선택 후 신청</li>\n    </ol>\n    <p>모바일 앱(LH 청약센터)으로도 가능하니까 편하신 방법으로 하시면 됩니다. 당첨되면 서류 제출 안내가 따로 오니까 먼저 신청부터 해놓으셔도 괜찮아요.</p>\n\n    <h3>더 알아두면 좋은 점</h3>\n    <ul>\n        <li><strong>첨부파일</strong>: 공고문과 단지별 팜플렛 다운받아서 꼼꼼히 읽어보세요. 이미지 보면 단지 분위기 파악하기 좋아요.</li>\n        <li><strong>당첨 확인</strong>: 예비입주자라 입주까지 시간이 걸릴 수 있어요. 공고문에 당첨자 조회 링크 있으니 나중에 확인해보시고요.</li>\n        <li><strong>문의</strong>: 궁금하신 게 있으면 1600-1004로 전화해보세요. 친절하게 도와줄 거예요.</li>\n    </ul>\n    <img src="${Siheng}" alt="트럼프와 젤렌스키 정상회담 인포그래픽" />\n    <h2>마무리</h2>\n    <p>저도 이 공고 보고 신청 고민 중인데, 여러분도 관심 있으시면 한번 알아보세요! 시흥시에서 안정적으로 살 기회 놓치지 않으셨으면 좋겠어요.</p>\n</body>`,createdAt:"2024-01-15",author:"Jane Doe"}],TRENDING_POSTS=POSTS_DETAIL.map((({id:e,title:t,views:r,excerpt:n,category:i})=>({id:e,title:t,views:r,excerpt:n,category:i}))),postService={getTrendingPosts:async()=>Promise.resolve(TRENDING_POSTS),getPostById:async e=>Promise.resolve(POSTS_DETAIL.find((t=>t.id===e)))},LayoutGroupContext=reactExports.createContext({});function useConstant(e){const t=reactExports.useRef(null);return null===t.current&&(t.current=e()),t.current}const isBrowser="undefined"!=typeof window,useIsomorphicLayoutEffect=isBrowser?reactExports.useLayoutEffect:reactExports.useEffect,PresenceContext=reactExports.createContext(null),MotionConfigContext=reactExports.createContext({transformPagePoint:e=>e,isStatic:!1,reducedMotion:"never"});function usePresence(e=!0){const t=reactExports.useContext(PresenceContext);if(null===t)return[!0,null];const{isPresent:r,onExitComplete:n,register:i}=t,a=reactExports.useId();reactExports.useEffect((()=>{if(e)return i(a)}),[e]);const o=reactExports.useCallback((()=>e&&n&&n(a)),[a,n,e]);return!r&&n?[!1,o]:[!0]}function addUniqueItem(e,t){-1===e.indexOf(t)&&e.push(t)}function removeItem(e,t){const r=e.indexOf(t);r>-1&&e.splice(r,1)}const noop$3=e=>e;let warning=noop$3,invariant$1=noop$3;warning=(e,t)=>{},invariant$1=(e,t)=>{if(!e)throw new Error(t)};const MotionGlobalConfig={useManualTiming:!1};function memo(e){let t;return()=>(void 0===t&&(t=e()),t)}const progress=(e,t,r)=>{const n=t-e;return 0===n?1:(r-e)/n};class SubscriptionManager{constructor(){this.subscriptions=[]}add(e){return addUniqueItem(this.subscriptions,e),()=>removeItem(this.subscriptions,e)}notify(e,t,r){const n=this.subscriptions.length;if(n)if(1===n)this.subscriptions[0](e,t,r);else for(let i=0;i<n;i++){const n=this.subscriptions[i];n&&n(e,t,r)}}getSize(){return this.subscriptions.length}clear(){this.subscriptions.length=0}}const secondsToMilliseconds=e=>1e3*e,millisecondsToSeconds=e=>e/1e3;functio